INSERT INTO `blogs` (`id`, `blog_category_id`, `title`, `description`, `image`, `slug`, `meta_title`, `meta_description`, `meta_keywords`, `status`, `created_by`, `updated_by`, `status_updated_by`, `created_by_ip`, `updated_by_ip`, `status_updated_by_ip`, `created_at`, `updated_at`) VALUES
(2, 1, 'Ultimate Guide to Bali\'s Hidden Beaches', 'Escape the crowds and discover Bali\'s secluded shores where turquoise waters meet lush cliffs. From the dramatic arches of Broken Beach to the serene whites sands of Virgin Beach, our guide covers access tips, best times to visit, and eco-friendly stays. Perfect for couples or solo travelers seeking paradise without the hustleâ€”book your customized itinerary with Get Journey Tours & Travels today.', '/storage/uploads/blogs/1481055220.jpg', 'ultimate-guide-to-balis-hidden-beaches', NULL, NULL, NULL, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-10-11 11:40:38', '2025-10-11 11:45:16'),
(3, 1, 'Osaka: Foodie\'s Paradise Guide', 'Dive into Osaka\'s vibrant street food scene, from sizzling takoyaki stalls to ramen alleys in Dotonbori. This guide maps out must-try eats, hidden izakayas, and cultural food tours, blending culinary adventures with temple visits. Whether you\'re a gourmet explorer or casual diner, Osaka\'s flavors will tantalizeâ€”let us plan your taste-bud journey.', '/storage/uploads/blogs/578934060.jpg', 'osaka-foodies-paradise-guide', NULL, NULL, NULL, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-10-11 11:41:35', '2025-10-11 11:45:09'),
(4, 2, 'Essential Packing List for Adventure Travel', 'Gear up smart for your next thrill: multi-tool knife, quick-dry layers, and a portable water purifier top our list for rugged escapades. Learn to pack light yet prepared, with tips on weather-proofing and space-saving hacks. Trusted by seasoned explorersâ€”pair this with our seamless booking services for worry-free adventures.', '/storage/uploads/blogs/377618581.jpg', 'essential-packing-list-for-adventure-travel', NULL, NULL, NULL, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-11 11:45:43', '2025-10-11 11:45:43'),
(5, 2, 'Budget Hacks for Solo Wanderers', 'Stretch your dollars further with off-season bookings, local SIM deals, and free walking tours. Our hacks include app recommendations for cheap eats and couchsurfing safety tips, ensuring solo travel stays affordable and fun. Discover more with Get Journey\'s expert-curated budget plans.', '/storage/uploads/blogs/606847562.jpg', 'budget-hacks-for-solo-wanderers', NULL, NULL, NULL, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-11 11:46:13', '2025-10-11 11:46:13'),
(6, 3, 'Best Hiking Trails in the Himalayas', 'Trek the Everest Base Camp or Annapurna Circuit amid snow-capped peaks and rhododendron blooms. This guide details difficulty levels, permits, and acclimatization stops for safe, exhilarating climbs. Fuel your inner mountaineer with our tailored adventure packages.', '/storage/uploads/blogs/167835999.jpg', 'best-hiking-trails-in-the-himalayas', NULL, NULL, NULL, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-11 11:46:43', '2025-10-11 11:46:43'),
(7, 3, 'Wildlife Safaris in Costa Rica', 'Spot toucans, sloths, and jaguars in the misty rainforests of Manuel Antonio or Tortuguero. Our safari guide covers ethical viewing spots, boat tours, and conservation tips for an unforgettable wildlife immersion. Adventure awaitsâ€”secure your spot today.', '/storage/uploads/blogs/2049406328.jpg', 'wildlife-safaris-in-costa-rica', NULL, NULL, NULL, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-11 11:47:09', '2025-10-11 11:47:09'),
(8, 4, 'Eco-Resorts in Thailand', 'Unwind at bamboo bungalows in Koh Yao Noi or organic farms in Chiang Mai, where sustainability meets serenity. Learn about zero-waste policies, farm-to-table dining, and mangrove restoration projects. Travel green with our eco-conscious itineraries.', '/storage/uploads/blogs/677135521.jpg', 'eco-resorts-in-thailand', NULL, NULL, NULL, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-11 11:47:35', '2025-10-11 11:47:35'),
(9, 4, 'Carbon-Neutral Trips: How to Travel Green', 'Offset flights, choose electric tours, and support reforestationâ€”our blueprint for guilt-free globetrotting. From train hops in Europe to solar-powered stays in Asia, discover practical steps for low-impact adventures. Join the movement with Get Journey.', '/storage/uploads/blogs/1456779080.jpg', 'carbon-neutral-trips-how-to-travel-green', NULL, NULL, NULL, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-11 11:47:54', '2025-10-11 11:47:54'),
(10, 5, 'Ultimate Luxury Train Rides Worldwide', 'Glide through Swiss Alps on the GoldenPass Express or Rajasthan\'s palaces via Maharajas\' Express. Savor gourmet meals and panoramic views in opulent carsâ€”our guide to rails redefining elegance. Elevate your voyage with bespoke luxury bookings.', '/storage/uploads/blogs/675066024.jpg', 'ultimate-luxury-train-rides-worldwide', NULL, NULL, NULL, 1, 1, NULL, 1, '127.0.0.1', NULL, '127.0.0.1', '2025-10-11 11:48:16', '2025-10-11 11:58:26'),
(11, 5, '5-Star Escapes in Tuscany', 'Indulge in vineyard villas at Borgo Santo Pietro or truffle hunts at Castello di Casole. This luxe guide highlights spa rituals, private chefs, and wine tastings amid olive groves. Timeless Italian splendor awaits your reservation.', '/storage/uploads/blogs/600755087.jpg', '5-star-escapes-in-tuscany', NULL, NULL, NULL, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-11 11:48:41', '2025-10-11 11:48:41'),
(12, 6, 'Europe with Kids: Magical Family Routes', 'From Venice gondola rides to Paris Disney magic, craft memories on kid-friendly paths through castles and canals. Tips for stroller-accessible spots and interactive museums make it seamless. Family fun, our wayâ€”customize yours now.', '/storage/uploads/blogs/776683486.jpg', 'europe-with-kids-magical-family-routes', NULL, NULL, NULL, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-11 11:49:17', '2025-10-11 11:49:17'),
(13, 6, 'Beach Vacays for All Ages', 'Build sandcastles in Florida\'s Clearwater or snorkel in Hawaii\'s family covesâ€”beaches blending relaxation and play. Our picks include shallow waters, playgrounds, and sunset picnics for multi-gen bliss. Waves of joy start here.', '/storage/uploads/blogs/392117184.jpg', 'beach-vacays-for-all-ages', NULL, NULL, NULL, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-11 11:49:39', '2025-10-11 11:49:39'),
(14, 7, 'Diwali in India: A Cultural Odyssey', 'Illuminate your senses with lantern-lit streets, rangoli artistry, and sweet feasts during India\'s Festival of Lights. From Delhi markets to Jaipur palaces, immerse in rituals and dances. Celebrate heritageâ€”our cultural tours light the path.', '/storage/uploads/blogs/1612319224.jpg', 'diwali-in-india-a-cultural-odyssey', NULL, NULL, NULL, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-11 11:50:06', '2025-10-11 11:50:06'),
(15, 7, 'Street Food Tours in Chiang Mai', 'Savor khao soi noodles and mango sticky rice amid night bazaars and temple shadows. This guide navigates spicy stalls, vendor stories, and hygiene hacks for authentic Thai bites. Flavor your journey with us.', '/storage/uploads/blogs/2136875890.jpg', 'street-food-tours-in-chiang-mai', NULL, NULL, NULL, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-11 11:50:34', '2025-10-11 11:50:34'),
(16, 8, 'Yoga Havens in Bali', 'Flow through sunrise salutations in Ubud\'s rice paddy studios or cliffside shalas in Canggu. Detox with Ayurvedic meals and sound baths for soul alignment. Rejuvenateâ€”our wellness packages restore balance.', '/storage/uploads/blogs/188582929.jpg', 'yoga-havens-in-bali', NULL, NULL, NULL, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-11 11:50:59', '2025-10-11 11:50:59'),
(17, 8, 'Detox Escapes in Iceland', 'Soak in Blue Lagoon\'s silica-rich waters or lava-field saunas for geothermal purification. Pair with Nordic hikes and volcanic facials to reset body and mind. Pure, icy blissâ€”detox with expert guidance.', '/storage/uploads/blogs/192720590.jpg', 'detox-escapes-in-iceland', NULL, NULL, NULL, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-11 11:51:26', '2025-10-11 11:51:26');
