INSERT INTO `features` (`id`, `feature_name`, `description`, `icon`, `slug`, `image`, `is_core_feature`, `status`, `created_by`, `updated_by`, `status_updated_by`, `created_by_ip`, `updated_by_ip`, `status_updated_by_ip`, `created_at`, `updated_at`) VALUES
(1, 'Biometric Screenings & Risk Assessments', 'On-site and virtual checks for blood sugar, blood pressure, cholesterol, and pre-diabetes with timely, actionable follow-up care.', NULL, 'biometric-screenings-risk-assessments', '/storage/uploads/features/1405287808.jpeg', 1, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-07-31 20:12:37', '2025-08-14 06:39:23'),
(2, 'Personalized Nutrition & Diabetes Coaching', 'One-on-one sessions with registered dieticians to create plant-based, glycaemic-friendly meal plans tailored to individual health goals.', NULL, 'personalized-nutrition-diabetes-coaching', NULL, 1, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-07-31 20:12:55', '2025-08-14 06:38:34'),
(3, 'Lifestyle & Physical Activity Plans', 'Customized fitness routines and daily movement goals to improve insulin sensitivity and support weight and well-being outcomes.', NULL, 'lifestyle-physical-activity-plans', NULL, 0, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-07-31 20:13:14', '2025-08-14 06:22:08'),
(4, 'Mindfulness & Stress Management', 'Guided meditation and cognitive techniques to reduce stress, enhance resilience, and curb emotional triggers for unhealthy behaviour.', NULL, 'mindfulness-stress-management', NULL, 1, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-07-31 20:13:34', '2025-07-31 20:13:34'),
(5, 'Educational Workshops & Peer Support', 'Interactive sessions on diabetes prevention, reversal strategies, and healthy living, plus community chats for peer encouragement.', NULL, 'educational-workshops-peer-support', NULL, 1, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-07-31 20:13:49', '2025-08-14 06:38:23'),
(6, 'Digital Health Tools & On-going Monitoring', 'Smartphone app integration, tele-counseling, weekly check-ins, and data tracking to ensure sustainable progress.', NULL, 'digital-health-tools-on-going-monitoring', NULL, 0, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-07-31 20:14:06', '2025-07-31 20:19:49');
