INSERT INTO `services` (`id`, `title`, `description`, `image`, `icon`, `slug`, `status`, `created_by`, `updated_by`, `status_updated_by`, `created_by_ip`, `updated_by_ip`, `status_updated_by_ip`, `created_at`, `updated_at`) VALUES
(1, 'Job Visa', 'Secure work opportunities abroad with employer-sponsored visas. We handle documentation, interviews, and compliance for skilled professionals in IT, healthcare, and engineering.', '/storage/uploads/services/951738764.jpg', NULL, 'job-visa', 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-07-31 19:51:20', '2025-10-13 19:30:22'),
(10, 'Business Visa', 'Ideal for entrepreneurs and executives expanding globally. Includes investor visas, trade permits, and setup guidance for starting or growing your business overseas.', '/storage/uploads/services/683406926.jpg', NULL, 'business-visa', 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-07-31 19:56:37', '2025-10-13 19:30:52'),
(11, 'Student Visa', 'Unlock international education with study permits. Assistance with university applications, financial proofs, and post-study work options in top destinations like the US, UK, and Canada.', '/storage/uploads/services/904311547.jpg', NULL, 'student-visa', 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-07-31 19:56:58', '2025-10-13 19:31:14'),
(12, 'Tourist Visa', 'Explore the world hassle-free with short-stay travel visas. Covers e-visas, group tours, and extensions, ensuring smooth entry for vacations and cultural visits.', '/storage/uploads/services/1129385691.jpg', NULL, 'tourist-visa', 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-07-31 19:57:12', '2025-10-13 19:31:43'),
(13, 'Residence Visa', 'Achieve long-term residency through family reunification, skilled migration, or investment programs. We guide you through points-based systems and permanent settlement pathways.', '/storage/uploads/services/2144642057.jpg', NULL, 'residence-visa', 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-07-31 19:57:26', '2025-10-13 19:32:05'),
(14, 'Diplomatic Visa', 'For government officials and envoys. Specialized support for protocol, security clearances, and bilateral agreements to facilitate official travel and postings.', '/storage/uploads/services/943081803.jpg', NULL, 'diplomatic-visa', 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-07-31 19:57:41', '2025-10-13 19:32:26');
