INSERT INTO `testimonials` (`id`, `name`, `designation`, `description`, `image`, `rating`, `status`, `created_by`, `updated_by`, `status_updated_by`, `created_by_ip`, `updated_by_ip`, `status_updated_by_ip`, `created_at`, `updated_at`) VALUES
(1, 'Raj Patel', 'IT Consultant', 'Thanks to their expert team, my Job Visa to Canada was approved in record time. The personalized guidance made the whole immigration process stress-free. Five stars!', '/storage/uploads/testimonials/1604322490.jpg', 5, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-08-06 11:08:20', '2025-10-14 06:30:25'),
(2, 'Sarah Thompson', 'Travel Blogger', 'The Exotic Bali Escape was a dream! From seamless visa processing to the guided temple tours, everything was perfect. Highly recommend Get Journey for hassle-free adventures.', '/storage/uploads/testimonials/1916798762.jpg', 5, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-08-08 05:41:37', '2025-10-14 06:29:58'),
(3, 'Emily Chen', 'Adventure Enthusiast', 'Loved the Himalayan Trekâ€”breathtaking views and amazing support. Minor delay in itinerary, but overall an unforgettable experience. Will book again!', '/storage/uploads/testimonials/1468753571.jpg', 4, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-14 06:30:54', '2025-10-14 06:30:54'),
(4, 'Michael Rodriguez', 'University Professor', 'Our family used the Student Visa service for my daughter\'s UK application. Professional, efficient, and affordable. She\'s thriving nowâ€”thank you, Get Journey', '/storage/uploads/testimonials/1929076730.jpg', 5, 1, 1, NULL, NULL, '127.0.0.1', NULL, NULL, '2025-10-14 06:31:28', '2025-10-14 06:31:28');
INSERT INTO `tours` (`id`, `country_id`, `name`, `description`, `short_description`, `image`, `price`, `slug`, `duration_days`, `status`, `created_by`, `updated_by`, `status_updated_by`, `created_by_ip`, `updated_by_ip`, `status_updated_by_ip`, `created_at`, `updated_at`) VALUES
(1, 75, 'Exotic Bali Escape', 'Unwind on pristine beaches, explore ancient temples, and enjoy spa retreats in tropical paradise. Includes flights and guided cultural tours.', 'Unwind on pristine beaches, explore ancient temples, and enjoy spa retreats in tropical paradise. Includes flights and guided cultural tours.', '/storage/uploads/tours/1581138169.jpg', 1200.00, 'exotic-bali-escape', 7, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-10-13 18:55:10', '2025-10-13 19:27:48'),
(2, 232, 'Himalayan Trek Adventure', 'Challenge yourself with moderate hikes through Nepal\'s stunning mountains, visiting monasteries and Sherpa villages. All gear and permits included.', 'Challenge yourself with moderate hikes through Nepal\'s stunning mountains, visiting monasteries and Sherpa villages. All gear and permits included.', '/storage/uploads/tours/1403767996.jpg', 1800.00, 'himalayan-trek-adventure', 10, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-10-13 18:55:46', '2025-10-13 19:27:29'),
(3, 45, 'European Wine Trail', 'Indulge in vineyard tours across France and Italy, with wine tastings, gourmet meals, and scenic train rides through rolling hills.', 'Indulge in vineyard tours across France and Italy, with wine tastings, gourmet meals, and scenic train rides through rolling hills.', '/storage/uploads/tours/1264255984.jpg', 2500.00, 'european-wine-trail', 12, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-10-13 18:56:20', '2025-10-13 19:27:40'),
(4, 39, 'Amazon Rainforest Explorer', 'Dive into biodiversity with boat safaris, wildlife spotting (jaguars, pink dolphins), and indigenous community visits in Peru. Eco-friendly lodging.', 'Dive into biodiversity with boat safaris, wildlife spotting (jaguars, pink dolphins), and indigenous community visits in Peru. Eco-friendly lodging.', '/storage/uploads/tours/1828814235.jpg', 950.00, 'amazon-rainforest-explorer', 5, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-10-13 18:56:53', '2025-10-13 19:27:17'),
(5, 26, 'Japanese Cherry Blossom Journey', 'Witness sakura blooms in Tokyo, Kyoto, and Hiroshima, blending modern city vibes with traditional tea ceremonies and bullet train travel.', 'Witness sakura blooms in Tokyo, Kyoto, and Hiroshima, blending modern city vibes with traditional tea ceremonies and bullet train travel.', '/storage/uploads/tours/814964070.jpg', 2200.00, 'japanese-cherry-blossom-journey', 9, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-10-13 18:57:38', '2025-10-13 19:27:09'),
(6, 208, 'African Safari Odyssey', 'Spot the Big Five on game drives in Kenya\'s Maasai Mara, with luxury tented camps, hot air balloon rides, and cultural Maasai encounters.', 'Spot the Big Five on game drives in Kenya\'s Maasai Mara, with luxury tented camps, hot air balloon rides, and cultural Maasai encounters.', '/storage/uploads/tours/1547229282.jpg', 3000.00, 'african-safari-odyssey', 8, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-10-13 18:58:13', '2025-10-13 19:26:57'),
(7, 117, 'Mediterranean Cruise Escape', 'Sail from Greece to Turkey, stopping at ancient ruins, blue lagoons, and vibrant markets. All-inclusive meals and onboard entertainment.', 'Sail from Greece to Turkey, stopping at ancient ruins, blue lagoons, and vibrant markets. All-inclusive meals and onboard entertainment.', '/storage/uploads/tours/1330101562.jpg', 1900.00, 'mediterranean-cruise-escape', 11, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-10-13 18:58:40', '2025-10-13 19:26:43'),
(8, 14, 'New Zealand Adventure Loop', 'Road trip through Lord of the Rings landscapes, with bungy jumping, glacier hikes, and wine tasting in both islands. Campervan rental included.', 'Road trip through Lord of the Rings landscapes, with bungy jumping, glacier hikes, and wine tasting in both islands. Campervan rental included.', '/storage/uploads/tours/52253552.jpg', 2800.00, 'new-zealand-adventure-loop', 14, 1, 1, 1, NULL, '127.0.0.1', '127.0.0.1', NULL, '2025-10-13 18:59:07', '2025-10-13 19:25:31');
